import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import InsightMakerEmbed from './InsightMakerEmbed'; // Component to handle the iframe embed
import '../styles/GrowthSimulation.css'; // Make sure you have some basic CSS

const GrowthSimulation = () => {
  const navigate = useNavigate();
  const [simulationParams, setSimulationParams] = useState(null);
  const [displayConditions, setDisplayConditions] = useState({ // State to hold values for display
      substrate: {},
      temperature: 0,
      ph: 0,
      yieldValue: 0, // Keep yield from previous step for display/reporting if needed
      days: 40 // Default or read from somewhere if needed
  });

  // --- Configuration ---
  // *** UPDATE THIS PATH if your exported file name is different ***
  const simulationUrl = '/insightmaker_exports/Simplified-Model-V3-1.html';

  useEffect(() => {
    // Load parameters from localStorage when the component mounts
    const savedTemperature = localStorage.getItem('temperature');
    const savedPh = localStorage.getItem('ph');
    const savedSubstrateJson = localStorage.getItem('substrate');
    const savedYield = localStorage.getItem('yield'); // Yield from ConditionSetting

    // Basic validation
    if (savedTemperature && savedPh && savedSubstrateJson) {
      try {
        const substrateData = JSON.parse(savedSubstrateJson);
        const temp = parseFloat(savedTemperature);
        const phValue = parseFloat(savedPh);
        const yieldVal = parseFloat(savedYield) || 0;

        // Store values for display on this page
        setDisplayConditions({
            substrate: substrateData,
            temperature: temp,
            ph: phValue,
            yieldValue: yieldVal,
            days: 40 // Or adjust as needed
        });

        // --- IMPORTANT: Parameter Mapping for InsightMaker ---
        // Create the parameters object to send to the simulation.
        // The keys MUST exactly match the Primitive names in your InsightMaker model.
        // *** REPLACE THE KEYS BELOW WITH YOUR ACTUAL INSIGHTMAKER PRIMITIVE NAMES ***
        const paramsForSimulation = {
          'Initial Temperature': temp, // Example Primitive Name - VERIFY in InsightMaker
          'Initial pH': phValue,          // Example Primitive Name - VERIFY in InsightMaker
          'Initial Rice Bran': substrateData.riceBran || 0, // Example Primitive Name - VERIFY
          'Initial Corn Cob': substrateData.corn || 0,       // Example Primitive Name - VERIFY
          'Initial Sugarcane': substrateData.sugarcane || 0, // Example Primitive Name - VERIFY
          'Initial Sawdust': substrateData.sawdust || 0,     // Example Primitive Name - VERIFY
          // Add any other parameters your InsightMaker model needs
        };
        // ----------------------------------------------------

        setSimulationParams(paramsForSimulation);
        console.log("GrowthSimulation: Loaded params from localStorage:", paramsForSimulation);

      } catch (error) {
        console.error("GrowthSimulation: Error processing data from localStorage:", error);
        alert("Error loading simulation settings. Returning to configuration.");
        navigate('/condition-setting');
      }
    } else {
      console.error("GrowthSimulation: Required parameters not found in localStorage.");
      alert("Simulation parameters not set. Please configure them first.");
      navigate('/condition-setting');
    }
  }, [navigate]); // Dependency array

  const handleBackClick = () => {
    navigate('/condition-setting'); // Navigate back to the settings page
  };

  // This function saves data based on the INITIAL conditions from localStorage.
  // If you need the FINAL results from the InsightMaker simulation,
  // you'll need bi-directional communication (InsightMaker sending results back).
  const handleViewReportClick = () => {
    const formatDate = (date) => {
      const day = String(date.getDate()).padStart(2, '0');
      const month = String(date.getMonth() + 1).padStart(2, '0');
      const year = date.getFullYear();
      return `${day}/${month}/${year}`;
    };

    // Using the displayConditions state which holds values loaded from localStorage
    const newEntry = {
      days: displayConditions.days,
      // Note: This yield is from the previous screen, not the simulation result
      yield: `${displayConditions.yieldValue}g`,
      substrate: Object.entries(displayConditions.substrate)
        .map(([key, value]) => {
             const displayNames = { riceBran: 'Rice Bran', corn: 'Corn Cob', sugarcane: 'Sugarcane', sawdust: 'Sawdust' };
             return `${displayNames[key] || key}: ${value}g`;
        })
        .join(', '),
      conditions: `Temperature: ${displayConditions.temperature}Â°C, pH: ${displayConditions.ph}`,
      date: formatDate(new Date()),
    };

    try {
        const existingHistory = JSON.parse(localStorage.getItem('growthHistory')) || [];
        localStorage.setItem('growthHistory', JSON.stringify([...existingHistory, newEntry]));
        navigate('/'); // Navigate to the Growth Report page (assuming '/' is the report page)
    } catch (error) {
        console.error("Error saving growth history:", error);
        alert("Could not save growth history.");
    }
  };

  // Map substrate keys to display names for the list
  const substrateDisplayNames = {
    riceBran: 'Rice Bran',
    corn: 'Corn Cob',
    sugarcane: 'Sugarcane',
    sawdust: 'Sawdust',
  };

  return (
    <div className="growth-simulation">
      <header className="simulation-header">
        <button className="back-button" onClick={handleBackClick}>
          â Back to Settings
        </button>
        <h1>Mushroom Growth Simulation</h1>
      </header>
      <main className="simulation-content">
        {/* InsightMaker Simulation Embed */}
        <div className="simulation-container"> {/* Optional: Add styling */}
          {simulationParams ? (
            <InsightMakerEmbed
              simulationUrl={simulationUrl}
              parameters={simulationParams}
              width="100%" // Adjust size as needed
              height="650px" // Adjust size as needed
              title="InsightMaker Mushroom Growth Model"
            />
          ) : (
            <p>Loading simulation parameters...</p> // Loading indicator
          )}
        </div>

        {/* Display Chosen Conditions */}
        <div className="chosen-conditions">
          <h3>Growth Conditions Used:</h3>
          <ul>
            {Object.entries(displayConditions.substrate).map(([key, value]) => (
              <li key={key}>
                {substrateDisplayNames[key] || key}: {value}g
              </li>
            ))}
            <li>Temperature: {displayConditions.temperature}Â°C</li>
            <li>pH: {displayConditions.ph}</li>
            {/* Display yield from previous step if desired */}
            {/* <li>Target Yield: {displayConditions.yieldValue}g</li> */}
            <li>Simulation Duration: {displayConditions.days} days</li>
          </ul>
        </div>

        {/* Done Button */}
        <button className="view-report-button" onClick={handleViewReportClick}>
          Done
        </button>
      </main>
    </div>
  );
};

export default GrowthSimulation;
